import { FC, useId } from "react";

type BranchesProps = {
  width: number;
};

export const Branches: FC<BranchesProps> = ({ width }) => {
  const uid = useId();
  const patternId = `pattern-${uid}`;
  const imageId = `image-${uid}`;

  return (
    <svg
      width={width}
      height={width * 58 / 188}
      viewBox={`0 0 188 58`}
      fill="none"
      xmlns="http://www.w3.org/2000/svg"
      xmlnsXlink="http://www.w3.org/1999/xlink"
    >
      <rect width="188" height="58" fill={`url(#${patternId})`} />
      <defs>
        <pattern
          id={patternId}
          patternContentUnits="objectBoundingBox"
          width="1"
          height="1"
        >
          <use
            xlinkHref={`#${imageId}`}
            transform="scale(0.000877193 0.002849)"
          />
        </pattern>
        <image
          id={imageId}
          width="1140"
          height="351"
          preserveAspectRatio="none"
          xlinkHref="data:image/png;base64,"
        />
      </defs>
    </svg>
  );
};
